ks.\n","\n","**generosity:** Cömertlik düzeyini gösteren bir endeks.\n","\n","**income_class:** Ülkelerin gelir sınıflandırmasını gösterir (örn. düşük gelir, orta gelir vs.).\n","\n","**cpi:** Yolsuzluk Algı Endeksi."]},{"cell_type":"code","execution_count":2,"id":"ba49f12a","metadata":{"execution":{"iopub.execute_input":"2023-11-10T18:20:27.453072Z","iopub.status.busy":"2023-11-10T18:20:27.417452Z","iopub.status.idle":"2023-11-10T18:20:27.474579Z","shell.execute_reply":"2023-11-10T18:20:27.472192Z"},"papermill":{"duration":0.066408,"end_time":"2023-11-10T18:20:27.477763","exception":false,"start_time":"2023-11-10T18:20:27.411355","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["212"],"text/latex":["212"],"text/markdown":["212"],"text/plain":["[1] 212"]},"metadata":{},"output_type":"display_data"}],"source":["# Veri setinde eksik verilerin kontrol edilmesi\n","missing_values_train <- sum(is.na(world_data))\n","missing_values_train"]},{"cell_type":"markdown","id":"bc5d5af6","metadata":{"papermill":{"duration":0.004376,"end_time":"2023-11-10T18:20:27.486545","exception":false,"start_time":"2023-11-10T18:20:27.482169","status":"completed"},"tags":[]},"source":["# Veri setindeki eksik değerlerin doldurulması"]},{"cell_type":"code","execution_count":3,"id":"441c0c2f","metadata":{"execution":{"iopub.execute_input":"2023-11-10T18:20:27.499073Z","iopub.status.busy":"2023-11-10T18:20:27.49738Z","iopub.status.idle":"2023-11-10T18:20:27.53271Z","shell.execute_reply":"2023-11-10T18:20:27.53092Z"},"papermill":{"duration":0.045093,"end_time":"2023-11-10T18:20:27.535938","exception":false,"start_time":"2023-11-10T18:20:27.490845","status":"completed"},"tags":[]},"outputs":[],"source":["# Orijinal veri setinin bir kopyasının saklanması\n","original_world_data <- world_data\n","\n","# country sütununu çıkartılması\n","world_data_numeric <- world_data[, !names(world_data) %in% c(\"country\")]\n","\n","# Veri setindeki eksik değerlerin doldurulması\n","for(i in 1:nco